","content":"<span class='clj-keyword'>:2</span>","value":":2"}],"value":"#{:2}"}],"value":"[:0 #{:2}]"},{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:2</span>","value":":2"},{"type":"list-like","open":"<span class='clj-set'>#{<span>","close":"<span class='clj-set'>}</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:0</span>","value":":0"},{"type":"html","content":"<span class='clj-keyword'>:2</span>","value":":2"}],"value":"#{:0 :2}"}],"value":"[:2 #{:0 :2}]"}],"value":"{:1 #{:3}, :0 #{:2}, :2 #{:0 :2}}"}],"value":"[:in {:1 #{:3}, :0 #{:2}, :2 #{:0 :2}}]"}],"value":"#loom.graph.BasicEditableWeightedDigraph{:nodeset #{:1 :0 :3 :2}, :adj {:0 {:2 2}, :3 {:1 1}, :2 {:0 0, :2 8}}, :in {:1 #{:3}, :0 #{:2}, :2 #{:0 :2}}}"}
;; <=

;; **
;;; `loom-view` calls out to GraphViz to draw the graph. It takes the same options as loom's `view` function.
;; **

;; @@
(loom-view (r-wdg) :alg :neato)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#loom_gorilla.render.LoomView{:content #loom.graph.BasicEditableWeightedDigraph{:nodeset #{:1 :0 :3 :2}, :adj {:1 {:0 1, :2 1}, :3 {:0 1}, :2 {:2 9, :0 8}}, :in {:2 #{:1 :2}, :0 #{:1 :3 :2}}}, :opts (:alg :neato)}"}
;; <=

;; **
;;; The `loom-view` rendered content works with the rest of Gorilla's renderer, and preserves the value of the underlying graph (alt+click on one of the graphs in a live worksheet to see the value).
;; **

;; @@
(table-view (repeatedly 3 (fn [] (repeatedly 2 #(loom-view (r-wdg) :alg :neato)))) 
            :columns [:foo (latex-view "\\sum_{n=0}^{foo} bar^n")])
